package com.nmims.app.Models;public class NewsEventDataModel{    private String type;    private String subject;    private String startTime;    private String description;    public NewsEventDataModel() {    }    public NewsEventDataModel(String type, String subject, String startTime, String description) {        this.type = type;        this.subject = subject;        this.startTime = startTime;        this.description = description;    }    public String getType() {        return type;    }    public void setType(String type) {        this.type = type;    }    public String getSubject() {        return subject;    }    public void setSubject(String subject) {        this.subject = subject;    }    public String getStartTime() {        return startTime;    }    public void setStartTime(String startTime) {        this.startTime = startTime;    }    public String getDescription() {        return description;    }    public void setDescription(String description) {        this.description = description;    }}